import React, {Component} from "react";

class TextItem extends Component {

    constructor(props) {
        super(props)
        this.state = {
            level: this.props.level
        }
    }

    render() {
        const className = 'item level' + this.props.level
        return(
            <div className={{className} `centerThisBitch`}>
                {this.props.id}
            </div>
        )
    }
}

export default TextItem

